import React from "react";

export default function Home(props) {
    return (
        <div>
            <p>Welcome to Home Page</p>
            <p>{props.username}</p>
            <p>{props.id}</p>
            <p>{props.token}</p>
            <p>balance: `${props.balance}`</p>
        </div>
    )
}
